css:
@-moz-document url-prefix("https://xuanji.appspot.com/isicp/") {
::selection {
  background: #ffb7b7; /* WebKit/Blink Browsers */
}
::-moz-selection {
  background: #ffb7b7; /* Gecko Browsers */
}
  body {
      background-color: #222222;
  }
  p, table, label, h1, h2, h3, h4, a {
      color: #777575;
  }
  blockquote {
      font-size: 1.1em !important;
      color: #b9aeae;
      font-family: helvetica;
      line-height: 1.4em;
  }
  .CodeMirror {
      font-size: 1.1em;
      background: #dddbd2;
  }
  .output {
      color: #e7dede;
  }
}
